# The file path of the validator location data
VALIDATOR_LOCATIONS_FILE_PATH = "validator_locations.txt"

# Builds a map of validator locations
def get_validator_locations():
    with open(VALIDATOR_LOCATIONS_FILE_PATH, 'r') as file:
        # Read the raw validator location data
        validator_locations_raw = file.read()

        # Parse the location string
        lines = [line.strip() for line in validator_locations_raw.strip().split("\n") if line.strip()]
        staking_pool_map = {lines[i]: lines[i + 1] for i in range(0, len(lines), 2)}

        # Convert to JSON
        validator_locations = json.loads(json.dumps(staking_pool_map, indent=2))
        return validator_locations


# Parses the peer state string and returns JSON
def parse_peer_state_string(data):
    parsed_data = {}

    # Regex pattern to extract each entry (thanks Chat-GPT!)
    pattern = re.compile(r'(Validator):([a-f0-9]+):\s+"PeerState\s+\{\s+\{(.*?)\}\s+\}"', re.DOTALL)

    # Extracting each entry
    for match in pattern.finditer(data):
        node_type = match.group(1)
        node_id = match.group(2)
        peer_state_raw = match.group(3)

        # Replacing key-value pairs with valid JSON format
        peer_state_json = peer_state_raw.replace("\n", " ")
        peer_state_json = peer_state_json.replace(" uptime: ", " \"uptime\": ")
        peer_state_json = peer_state_json.replace("s }", " }")
        peer_state_json = re.sub(r'([a-z_]+):', r'"\1":', peer_state_json)
        peer_state_json = "{" + peer_state_json + "}"  # Ensure it's wrapped in curly braces

        # Convert to dictionary
        try:
            peer_state_dict = json.loads(peer_state_json)
        except json.JSONDecodeError as e:
            print(f"Error decoding JSON for {node_type}:{node_id}: {e}")
            continue

        parsed_data[f"{node_type}:{node_id}"] = peer_state_dict

    return parsed_data


# Returns a map of peer_id -> average_ping_latency_secs
def get_latency_map(peer_state_string):
    # Create a latency map
    parsed_json = parse_peer_state_string(peer_state_string)
    latency_map = {}
    for peer_id in parsed_json:
        latency = parsed_json[peer_id]["average_ping_latency_secs"]
        latency_map[peer_id] = latency

    # Sort the latency map by latency
    latency_map = dict(sorted(latency_map.items(), key=lambda item: item[1]))
    return latency_map


# Analyzes the latency map and prints the results
def analyze_latency(region, latency_map):
    # Calculate the average latency
    total_latency = sum(latency_map.values())
    average_latency = total_latency / len(latency_map)

    # Calculate the median latency
    latency_values = list(latency_map.values())
    latency_values.sort()
    median_latency = latency_values[len(latency_values) // 2]

    # Calculate the 90th percentile latency
    percentile_90_index = int(len(latency_values) * 0.9)
    percentile_90_latency = latency_values[percentile_90_index]

    # Calculate the 99th percentile latency
    percentile_99_index = int(len(latency_values) * 0.99)
    percentile_99_latency = latency_values[percentile_99_index]

    print(f"Aptos Validator Region: {region}")
    print(f"- Average peer latency: {average_latency} seconds")
    print(f"- Median peer latency: {median_latency} seconds")
    print(f"- 90th percentile peer latency: {percentile_90_latency} seconds")
    print(f"- 99th percentile peer latency: {percentile_99_latency} seconds")

    # Count the number of nodes with latency < 100 ms
    count = 0
    for latency in latency_values:
        if latency < 0.1:
            count += 1
    print(f"- Number of peers with RTT < 100 ms: {count}, total: {len(latency_values)}")

# Find the location of a peer_id in the validator_locations map.
# Raises a KeyError if the location is not found.
def find_location(peer_id, validator_locations):
    # Transform the peer_id (remove "Validator:" and get the first 4 characters)
    transformed_peer_id = peer_id.replace("Validator:", "")[:4]
    #print(f"Peer ID: {peer_id}, Transformed: {transformed_peer_id}")

    for key in validator_locations:
        # Transform the key (remove "0x" and get the first 4 characters)
        transformed_key = key.replace("0x", "")[:4]
        #print(f"Key: {key}, Transformed: {transformed_key}")

        if transformed_peer_id in transformed_key:
            return validator_locations[key]
    raise KeyError(f"Location not found for {peer_id}")


